Defendant Katherine Kimbrough in court with attorney Megan Barbara.  Defendant Katherine Kimbrough in custody.  Deann L Heard appeared on behalf of Kimberly D. Schoepp for the State of Wisconsin.  Plea hearing proceeds.  Defendant was advised of constitutional rights and maximum penalties, and further advised that if not a United States citizen deportation is possible. Defendant sworn, examined as to plea, and entered a plea of guilty.  Court found defendant freely, voluntarily and intelligently waived all constitutional rights. Plea questionnaire waiver of rights and addendum to plea questionnaire received and filed. Parties stipulated to the criminal complaint as factual basis to sustain defendant's plea. Court found defendant guilty as charged in the Information and ordered a Judgment of Conviction be entered into the record.  The Court advised defendant that as a convicted felon not to possess any firearms/body armor.    Court further advised defendant of voting ineligibility. 

Sentencing proceeded.  Statements by the State, defense and defendant.  Additional statements by:  Ms. Donna Hietpas, Benedict Center.  The Court imposed the following sentence:

The Court imposed one (1) year at the House of Correction, with Huber for work and treatment; good time allowed.  Credit for 84 days time served.  Court STAYED said sentence and placed defendant on probation for two (2) years.
 * Court ordered to provide a DNA sample.

CONDITIONS OF PROBATION:
 - Undergo a mental health evaluation; follow thru with any treatment recommended;
 - No alcohol;
 - No controlled substances other than those legally prescribed for defendant by duly licensed physician for her mental or physical needs; 
 - AODA assessment and treatment;
 - Urine screens;
 - Court recommended to Probation Department to refer defendant to Benedict Center; defendant must comply with all treatment and programming recommended;
 - Anger mangement;
 - Seek and maintain employment;
 - Job and vocational training;
 - Cognitive thinking intervention counseling;
 - Pay the DNA surcharge, costs, disbursements and supervision fees.  Failure to pay would result in a civil judgment entered against defendant which is non-dischargable in bankruptcy.

Filed,
Notice of Right to Seek Postconviction Relief;
Pretrial Incarceration Credit form;
Ineligible Voting Notice and Acknowledgement.
